import React from 'react';
import { useNavigate } from 'react-router-dom';


const Home = () => {
  const navigate = useNavigate();

  return (
    <div className="container">
      <div className="home-header">
        <h1>Book Library</h1>
        <button onClick={() => navigate("/dash")}>My Books</button>
      </div>
      <div className="genre-buttons">
        <div className="genre-button" onClick={() => navigate("/sci-fi")}
         img src="Images\sct-fi.png" alt="sci-fi"  >
                Science-fiction
            </div>
        <div className="genre-button" onClick={() => navigate("/horror")}>Horror</div>
        <div className="genre-button" onClick={() => navigate("/mystery")}>Mystery</div>
        <div className="genre-button" onClick={() => navigate("/adventure")}>Adventure</div>
        </div>
        <div className="home-header">
        <button onClick={() => navigate("/genre")}>More Genre</button>
      </div>
    </div>
  );
};

export default Home;
